INSERT INTO shop_product VALUES(1,'Ветровка Reebok Stormshield',replace(replace('Лёгкая, технологичная и невероятно практичная ветровка от Reebok — идеальный выбор для городских прогулок, пробежек и тренировок на свежем воздухе. Благодаря водоотталкивающему покрытию Stormshield™ вы останетесь сухими даже под дождём, а ветрозащитный крой не даст продуться в прохладную погоду.\r\n\r\nМатериал: 100% переработанный полиэстер — экологично и прочно\r\nОсобенности: регулируемый капюшон, карманы с молнией, эластичные манжеты\r\nФасон: свободный крой для комфорта движений\r\nСтиль: минимализм с фирменным логотипом Reebok на груди\r\nСочетайте с джоггерами и кроссовками — и вы готовы к любому вызову дня!','\r',char(13)),'\n',char(10)),2000,'products/5f0df035d4771d25a47c0b41-1.jpg',7);
INSERT INTO shop_product VALUES(2,'Футболка Nike Dri-FIT ADV','Технология Dri-FIT ADV отводит влагу и обеспечивает вентиляцию в зонах повышенного потоотделения. Лёгкий, эластичный материал повторяет движения тела. Идеальна для бега, тренировок и повседневной носки.',2490,'products/i.webp',5);
INSERT INTO shop_product VALUES(3,'Шорты Adidas Own The Run 5"','Амортизация NITRO™ обеспечивает мягкость и отзывчивость на каждом шаге. Верх из дышащего мешка, резиновая подошва с отличным сцеплением. Для бега, зала и улицы.',8990,'products/adidas-own-the-run-climacool-colorblock-5-shorts.webp',0);
INSERT INTO shop_product VALUES(4,'Толстовка Under Armour Tech Zip','Утеплённая толстовка с молнией и капюшоном. Технология UA Tech™ отводит влагу, а мягкая флисовая подкладка сохраняет тепло. Стильный крой и фирменный логотип на груди.',4790,'products/51774f801c484d9cb19588d8739f00a4.jpeg',0);
INSERT INTO shop_product VALUES(5,'Леггинсы Gymshark Vital Seamless 2.0','Бесшовные леггинсы с компрессионной посадкой и зонами вентиляции. Материал 4-Way Stretch тянется во всех направлениях, не сковывая движений. Подчёркивают форму и не сползают во время тренировки.',3590,'products/ae6ddf13027773fd00809071e02a2d1f66c45653_original.jpeg',0);
